(function () {
    'use strict';

    define('services/core/code',['services/data/datacontext'],
        function (datacontext) {

            var service = {
                getLocalizedCodes: getLocalizedCodes,
                getLocalizedCodeSet: getLocalizedCodeSet,
                getMappedCodes: getMappedCodes
            };

            return service;

            function getLocalizedCodeSet(codeSetId) {
                var codeSet = {
                    codeSetId: codeSetId,
                    codes: getLocalizedCodes(codeSetId)
                };

                codeSet.getById = function (codeValue) {
                    return codeSet.codes.filter(function (code) {
                        return code.codeValue() === codeValue;
                    })[0];
                };

                return codeSet;
            }

            function getLocalizedCodes(codeSetId) {
                var codeset = datacontext.codesets.getItemById(codeSetId);

                return codeset.codes().map(function (code) {
                    if (!code.dataDefinitionId || !code.dataDefinitionId()){
                        throw 'Code does not contain data definition';
                    }

                    var dataDefinitionId = code.dataDefinitionId().substring(0, 1).toLowerCase() + code.dataDefinitionId().substring(1);

                    return {
                        codeValue: code.codeValue,
                        name: ko.observable(datacontext.translations.item[dataDefinitionId]()),
                        codeSetId: code.codeSetId,
                        sortOrder: code.sortOrder
                    };
                });
            }

            function getMappedCodes(fromCodeSetId, toCodeSetId, fromValues) {
                var toCodeSet = getLocalizedCodeSet(toCodeSetId);

                if (fromValues && !Array.isArray(fromValues)) {
                    fromValues = [fromValues];
                }

                return datacontext.codeMappings.items().filter(function(mapping){
                    if (mapping.fromCodeSetId() === fromCodeSetId &&
                        mapping.toCodeSetId() === toCodeSetId) {

                        return !fromValues || fromValues.indexOf(mapping.fromCode()) > -1;
                    }
                }).map(function(mapping){
                    return toCodeSet.getById(mapping.toCode());
                });
            }
        }
    );
})();

(function () {
    'use strict';

    define('services/core/security',['services/data/datacontext', 'services/core/code', 'model/model'],
        function (datacontext, codeSvc, model) {

            var service = {
                checkAccess: checkAccess,
                checkAdminAccess: checkAdminAccess,
                checkCompanyAdminAccess: checkCompanyAdminAccess,
                checkCompanyUserAccess: checkCompanyUserAccess,
                checkEntityAccess: checkEntityAccess,
                checkPartyAccess: checkPartyAccess,
                listCompanyAccess: listCompanyAccess,
                listCompanyVacancyAccess: listCompanyVacancyAccess,
                getSecurityObjectsForEdit: getSecurityObjectsForEdit,
                getUserGroupName: getUserGroupName,
                updateAccessList: updateAccessList
            };

            return service;

            function checkEntityAccess(entityId, objectTypeCode, operation) {
                return checkAccess({
                    entityId: entityId,
                    objectTypeCode: objectTypeCode,
                    operationTypeCode: operation
                });
            }

            function checkPartyAccess(partyId, objectTypeCode, operation) {
                return checkAccess({
                    partyId: partyId,
                    objectTypeCode: objectTypeCode,
                    operationTypeCode: operation
                });
            }

            function checkAccess(options) {

                var partyId = options.partyId;
                var entityId = options.entityId;
                var objectTypeCode = options.objectTypeCode;
                var operationTypeCode = options.operationTypeCode;

                for (var i = 0; i < datacontext.user.item.accessLists().length; i++) {

                    var accessList = datacontext.user.item.accessLists()[i];

                    if ((accessList.partyId() === partyId || !partyId) && (accessList.entityId() === entityId || !entityId)) {
                        for (var o = 0; o < accessList.operations().length; o++) {
                            var operation = accessList.operations()[o];

                            if (operation.objectTypeCode() === objectTypeCode && (operation.operationTypeCode() === operationTypeCode || !operationTypeCode)) {
                                return true;
                            }
                        }
                    }
                }

                return false;
            }

            function checkAdminAccess() {
                var objectTypeCodes = ['accessList'];

                for (var i = 0; i < objectTypeCodes.length; i++) {
                    if (!checkAccess({objectTypeCode: objectTypeCodes[i]})) {
                        return false;
                    }
                }

                return true;
            }

            function checkCompanyAdminAccess() {
                var objectTypeCodes = ['company', 'vacancy'];

                for (var i = 0; i < objectTypeCodes.length; i++) {
                    if (!checkAccess({objectTypeCode: objectTypeCodes[i]})) {
                        return false;
                    }
                }

                return true;
            }

            function checkCompanyUserAccess() {
                var objectTypeCodes = ['vacancy'];

                for (var i = 0; i < objectTypeCodes.length; i++) {
                    if (checkAccess({objectTypeCode: objectTypeCodes[i]})) {
                        return true;
                    }
                }

                return false;
            }

            function getSecurityObjectsForEdit(accessList) {
                var codeSet = codeSvc.getLocalizedCodeSet('objectType');
                var objects = [];

                codeSet.codes.forEach(function (item) {

                    var objectType = {
                        code: item,
                        operations: ko.observableArray()
                    };

                    codeSvc.getMappedCodes('objectType', 'operationType', item.codeValue()).forEach(function (operationCode) {
                        objectType.operations.push({
                            isSelected: ko.observable(accessList.checkAccess(item.codeValue(), operationCode.codeValue())),
                            code: operationCode
                        });
                    });

                    objects.push(objectType);
                });

                return objects;
            }

            function getUserGroupName(id) {
                var item = ko.utils.arrayFirst(datacontext.userGroups.items(), function (item) {
                    return item && item.id() === id;
                });

                return item ? item.name() : '<i class="fa fa-ban make-danger"></i>';
            }

            function listCompanyAccess() {
                var objectTypeCodes = ['company'];
                var companies = [];

                for (var i = 0; i < datacontext.companies.items().length; i++) {
                    var company = datacontext.companies.items()[i];

                    for (var o = 0; o < objectTypeCodes.length; o++) {
                        if (checkAccess({partyId: company.organizationId(), objectTypeCode: objectTypeCodes[o]})) {
                            companies.push(company);
                            continue;
                        }
                    }
                }

                return companies;
            }

            function listCompanyVacancyAccess() {
                var objectTypeCodes = ['vacancy'];
                var companies = [];

                for (var i = 0; i < datacontext.companies.items().length; i++) {
                    var company = datacontext.companies.items()[i];

                    for (var o = 0; o < objectTypeCodes.length; o++) {
                        if (checkAccess({partyId: company.organizationId(), objectTypeCode: objectTypeCodes[o]})) {
                            companies.push(company);
                            continue;
                        }
                    }
                }

                return companies;
            }

            function updateAccessList(accessList, objects) {
                var operations = [];

                accessList.operations([]);

                objects.forEach(function (objectType) {
                    objectType.operations().filter(function (operation) {
                        return operation.isSelected();
                    }).forEach(function (selectedOperation) {
                        var operation = new model.AccessListOperation();

                        operation.objectTypeCode(objectType.code.codeValue());
                        operation.operationTypeCode(selectedOperation.code.codeValue());

                        operations.push(operation);
                    });
                });

                accessList.operations(operations);
            }
        }
    );
})();

(function () {
    'use strict';

    define('services/data/dataprimer',[
            'services/core/logger',
            'services/core/config',
            'services/data/datacontext',
            'services/core/security',
            'services/core/state'],
        function (logger, config, datacontext, security, state) {

            var service = {
                getCaptions: getCaptions,
                init: init
            };

            function getCaptions() {
                return datacontext.translations.getItem(state.languageCode()).then(function () {
                });
            }

            return service;

            function init(dontShowLoading) {

                if (!dontShowLoading) {
                    state.isLoading(true);
                }

                return $.Deferred(function (def) {
                    return $.when(
                        datacontext.codeMappings.getData(),
                        datacontext.codesets.getData(),
                        datacontext.companies.getData(state.userId),
                        datacontext.timeZones.getData(),
                        datacontext.vacancies.getData(), // only current user's vacancies
                        datacontext.myVacancyApplications.getData({userAccountId: state.userId}),
                        //datacontext.candidateProfiles.getData(), // todo: check for candidates only
                        //datacontext.organizations.getData(),
                        datacontext.templates.getData(),
                        datacontext.contents.getData(),
                        datacontext.user.getItem(state.userId),
                        datacontext.documentLibrariesVitrine.getData()
                    )
                        .done(function () {

                            var isAdministrator = security.checkAdminAccess();
                            var isCompanyAdminAccess = security.checkCompanyAdminAccess(state.userId);

                            state.isAdministrator(isAdministrator);
                            state.isCompanyAdmin(isCompanyAdminAccess);
                            state.languageCode(datacontext.user.item.user.person.languageCode());
                            state.hasPendingRequest(datacontext.user.item.hasPendingRequest());
                            getCaptions();
                            state.setIsAuthenticated(true);

                            def.resolve();
                        })
                        .fail(function () {
                            state.isLoading(false);
                            logger.log('DataPrimer faced some issues');
                            def.reject();
                        }).then(function () {
                            state.isLoading(false);
                        });
                }).promise();
            }
        });
})();

